{
  "name": "UBX-MON-RF",
  "class_id": "0x0a",
  "message_id": "0x38",
  "description": "RF information",
  "message_type": "periodic_polled",
  "payload_length": {
    "variable": {
      "base": 4,
      "formula": "4 + nBlocks * 24"
    }
  },
  "fields": [
    {
      "byte_offset": 0,
      "data_type": "U1",
      "name": "version",
      "description": "Message version (0x00 for this version)",
      "fixed_value": 0
    },
    {
      "byte_offset": 1,
      "data_type": "U1",
      "name": "nBlocks",
      "description": "The number of RF blocks included"
    },
    {
      "byte_offset": 2,
      "data_type": {
        "array_of": "U1",
        "count": 2
      },
      "name": "reserved0",
      "reserved": true
    },
    {
      "byte_offset": 4,
      "data_type": {
        "repeated_group": true,
        "count_field": "nBlocks",
        "block_length": 24
      },
      "name": "repeated_block",
      "description": "Repeated for each RF block",
      "fields": [
        {
          "byte_offset": 0,
          "data_type": "U1",
          "name": "blockId",
          "description": "RF block ID (0 = L1 band, 1 = L2 or L5 band depending on product configuration)"
        },
        {
          "byte_offset": 1,
          "data_type": "X1",
          "name": "flags",
          "description": "Output from jamming/interference monitor (0 = unknown or feature disabled or flag unavailable, 1 = ok - no significant jamming, 2 = warning - interference visible but fix OK, 3 = critical - interference visible and no fix). This flag is deprecated in protocol versions that support UBX-SEC-SIG (version 0x02) and always reported as 0; instead jammingState in UBX-SEC-SIG should be monitored. (bits 1-0: jammingState)"
        },
        {
          "byte_offset": 2,
          "data_type": "U1",
          "name": "antStatus",
          "description": "Status of the antenna supervisor state machine (0x00=INIT, 0x01=DONTKNOW, 0x02=OK, 0x03=SHORT, 0x04=OPEN)"
        },
        {
          "byte_offset": 3,
          "data_type": "U1",
          "name": "antPower",
          "description": "Current power status of antenna (0x00=OFF, 0x01=ON, 0x02=DONTKNOW)"
        },
        {
          "byte_offset": 4,
          "data_type": "U4",
          "name": "postStatus",
          "description": "POST status word"
        },
        {
          "byte_offset": 8,
          "data_type": {
            "array_of": "U1",
            "count": 4
          },
          "name": "reserved1",
          "reserved": true
        },
        {
          "byte_offset": 12,
          "data_type": "U2",
          "name": "noisePerMS",
          "description": "Noise level as measured by the GPS core"
        },
        {
          "byte_offset": 14,
          "data_type": "U2",
          "name": "agcCnt",
          "description": "AGC Monitor, as percentage of maximum gain, range 0 to 8191 (100%)"
        },
        {
          "byte_offset": 16,
          "data_type": "U1",
          "name": "cwSuppression",
          "description": "CW interference suppression level, scaled (0=no CW jamming, 255 = strong CW jamming)"
        },
        {
          "byte_offset": 17,
          "data_type": "I1",
          "name": "ofsI",
          "description": "Imbalance of I-part of complex signal, scaled (-128 = max. negative imbalance, 127 = max. positive imbalance)"
        },
        {
          "byte_offset": 18,
          "data_type": "U1",
          "name": "magI",
          "description": "Magnitude of I-part of complex signal, scaled (0 = no signal, 255 = max.magnitude)"
        },
        {
          "byte_offset": 19,
          "data_type": "I1",
          "name": "ofsQ",
          "description": "Imbalance of Q-part of complex signal, scaled (-128 = max. negative imbalance, 127 = max. positive imbalance)"
        },
        {
          "byte_offset": 20,
          "data_type": {
            "array_of": "U1",
            "count": 4
          },
          "name": "reserved_block_padding",
          "reserved": true,
          "description": "Reserved for padding to make block 24 bytes"
        }
      ]
    }
  ]
}
